CREATE SCHEMA `employee_company_salary` ;

use employee_company_salary;

drop table if exists company;
drop table if exists employee;
drop table if exists salary;


CREATE TABLE `company` (
  `index` INT NOT NULL,
  `name` VARCHAR(145) NULL,
  `industry` VARCHAR(2000) NULL,
  `sector` VARCHAR(2000) NULL,
  `headquarters` VARCHAR(45) NULL,
  `founded` INT(4) NULL,
  `notes` LONGTEXT NULL,
  PRIMARY KEY (`index`));


CREATE TABLE `employee` (
  `index` INT NOT NULL,
  `employeeID` INT NULL,
  `name` VARCHAR(145) NULL,
  PRIMARY KEY (`index`));


CREATE TABLE `salary` (
  `index` INT NOT NULL,
  `employeeId` INT NULL,
  `companyID` INT NULL,
  `salary` INT NULL,
  PRIMARY KEY (`index`));













